import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Nav extends Component {
    render() {
        return (

            <div className="row menuSegundario justify-content-center d-flex">
                <div className="col-6 my-2 justify-content-center d-flex">
                    <nav className="nav flex-column">
                            <Link to={'/Pasteles'}> <input type="button"className="btn btn-success text-white mb-1 btn-lg" />Pasteles </Link>
                            <Link to={'/Galletas'}> <input type="button"className="btn btn-success text-white mb-1" />Galletas </Link>
                            <Link to={'/Cremas Dulces'}> <input type="button"className="btn btn-success text-white mb-1" /> Cremas Dulces  </Link>
                            <Link to={'/Bizcochos'}> <input type="button"className="btn btn-success text-white mb-1" />Bizcochos </Link>
                            <Link to={'/Magdalenas'}> <input type="button"className="btn btn-success text-white mb-1" /> Magdalenas  </Link>
                            <Link to={'/Mousse'}> <input type="button"className="btn btn-success text-white mb-1" /> Mousse  </Link>
                            <Link to={'/Recetas Faciles'}> <input type="button"className="btn btn-success text-white mb-1" /> Recetas Faciles  </Link>
                    </nav>
                </div>
            </div>
        )
    }
}

export default Nav;
